"""## 5. Avaliação de Expressões Pós-fixa (ou Notação Polonesa Reversa)
## Descrição: crie um programa Python que avalie uma expressão matemática na forma pós-fixa (ou notação polonesa reversa) usando uma pilha. A expressão pós-fixa é uma notação onde os operadores seguem seus operandos e dispensa parênteses.
## Entrada: "2 3 + 5 *"
## Resultado: 25 (resultado da expressão)
## Entrada: " 7 4 – 3 * 16 2 / -"
## Resultado: 1 (resultado da expressão)
## Dica de Implementação:
## 1. Divida a expressão em tokens separados por espaços.
## 2. Percorra os tokens da expressão.
## 3. Se encontrar um operando (número), empilhe-o.
## 4. Se encontrar um operador, desempilhe dois operandos, aplique o operador e empilhe o resultado.
## 5. No final, o resultado estará no topo da pilha.
"""

op = {"+": lambda op1, op2: op1 + op2,
      "-": lambda op1, op2: op1 - op2,
      "*": lambda op1, op2: op1 * op2,
      "/": lambda op1, op2: op1 / op2}

def avalia(expr):
  pilha = queue.LifoQueue()
  tokens = expr.split()

  for tk in tokens:
    if tk.isdigit():
      pilha.put(float(tk))
    elif tk in op:
      op2 = pilha.get()
      op1 = pilha.get()
      res = op[tk](op1, op2)
      pilha.put(res)
  return pilha.get()

avalia("7 4 - 3 * 16 2 / -")

"""## 6. Cálculo de média móvel (como eram construídos os gráficos na pandemia) Escreva uma função que recebe uma lista de números e um tamanho de janela como entrada. A função deve calcular a média móvel dos números em cada janela deslizante usando uma fila. Por exemplo, se a lista for

## [3, 5, 7, 10, 6, 4, 5, 8, ...]

## e o tamanho da janela for 3, a média móvel seria

## [5.00, 7.33, 7.67, 6.67, 5.00, 5.67, ...]

## Note:
## 5.00 = (3 + 5 + 7) / 3
##7.33 = (5 + 7 + 10) / 3
##7.67 = (7 + 10 + 6) / 3
##6.67 = (10 + 6 + 4) / 3
##5.00 = (6 + 4 + 5) / 3
##5.67 = (4 + 5 + 8) / 3
"""

valores = [3, 5, 7, 10, 6, 4, 5, 8]
jan = 3

def mm(seq, jan):
  fila = queue.Queue()
  soma = 0
  mmov = []

  for i, n in enumerate(seq):
    fila.put(n)
    soma += n
    if i >= jan - 1:
      mmov.append(soma/jan)
      soma -= fila.get()
  return mmov

mm(valores, jan)

