"""## 8. Busca por elemento alvo em matriz com uso de fila e set
## Desenvolva uma função que localiza um dado elemento alvo em uma matriz a partir de uma posição inicial qualquer para início da busca. Durante a busca, verificamos se o valor atual na posição visitada da matriz é igual ao alvo. Se for, imprimimos a posição e encerramos a busca (mesmo que haja outras ocorrências do alvo na matriz*). Casocontrário, continuamos a busca até visitar todas as posições da matriz.
## A solução deste exercício é dada para servir de material de estudo para o entendimento de algumas técnicas úteis usadas no desenvolvimento de algoritmos.
## Implemente e teste o algoritmo e teste-o para diversas matrizes de entrada, diferentes pontos de início, com e sem o elemento alvo presente na matriz. Comente o código para demosntrar que compreendeu o algoritmo.
## A solução é apresentada na próxima página.
## * Como o algoritmo deve ser alterado para apresentar todas as ocorrências do alvo?
"""

def busca_matriz (matriz, inicio, alvo):
  linhas, colunas = len(matriz), len (matriz[0])
  visitados = set()
  fila = queue.Queue()
  fila.put(inicio)
  while not fila.empty():
    x, y = fila.get()
    if (x, y) not in visitados:
      visitados.add((x, y))
      valor_atual = matriz [x][y]
      print (f"Visitando posição ({x}, {y}): {valor_atual}")
      if valor_atual == alvo:
        print (f"Encontramos o alvo {alvo} na posição ({x}, {y})")
      return True

      for dx, dy in [(1, 0), (1, 0), (0, 1), (0, -1)]:
        nx, ny = x + dx, y + dy
        if (0 <= nx < linhas and 0 <= ny < colunas and
         (nx, ny) not in visitados):
          fila.put((nx, ny))
        print (f"0 alvo {alvo} não foi encontrado na matriz.")
  return False

matriz = [[1, 2, 3], [4, 5, 6], [7, 8, 9]]
alvo = 5
busca_matriz (matriz, (0, 0), alvo)